import Axios from "axios";

export const getRoomList = async () => {
  return async (dispatch) => {
    const result = await Axios({
      method: "GET",
      url: "http://localhost:8000/rooms",
    });

    dispatch({
      type: "FETCH_ROOM",
      payload: result.data,
    });
  };
};
